import React, { useState, useEffect } from "react";
import "./App.css";

function FinancialData() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [sortBy, setSortBy] = useState('revenue');
  const [order, setOrder] = useState('asc');
  const [filterBy, setFilterBy] = useState('');  // Add state for filter column
  const [filterValue, setFilterValue] = useState(''); // Add state for filter value

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Construct query params with filtering
        const response = await fetch(
          `http://localhost:5000/api/data?sort_by=${sortBy}&order=${order}&filter_by=${filterBy}&filter_value=${filterValue}`
        );
        const result = await response.json();
        console.log("Fetched data:", result);
        setData(result);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [sortBy, order, filterBy, filterValue]); // Re-fetch data when filter values change

  const handleSort = (column) => {
    if (sortBy === column) {
      setOrder(order === 'asc' ? 'desc' : 'asc');
    } else {
      setSortBy(column);
      setOrder('asc');
    }
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    if (name === 'filterBy') {
      setFilterBy(value);
    } else if (name === 'filterValue') {
      setFilterValue(value);
    }
  };

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (error) {
    return <div className="error">Error: {error.message}</div>;
  }

  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      <h1 className="text-3xl font-bold text-gray-800 text-center mb-8">Annual Financial Data for Apple</h1>

      {/* Filter UI */}
      <div className="mb-6">
        <label className="mr-4">Filter By:</label>
        <select
          name="filterBy"
          value={filterBy}
          onChange={handleFilterChange}
          className="border p-2"
        >
          <option value="">Select Field</option>
          <option value="date">Date</option>
          <option value="revenue">Revenue</option>
          <option value="netIncome">Net Income</option>
          <option value="grossProfit">Gross Profit</option>
          <option value="eps">EPS</option>
          <option value="operatingIncome">Operating Income</option>
        </select>

        <input
          type="text"
          name="filterValue"
          value={filterValue}
          onChange={handleFilterChange}
          className="ml-4 border p-2"
          placeholder="Enter filter value"
        />
      </div>

      <table className="table-auto w-full border border-gray-200 shadow-lg">
        <thead className="bg-gray-100">
          <tr>
            <th onClick={() => handleSort('date')}
              className="px-4 py-2 border border-gray-700">Date</th>
            <th onClick={() => handleSort('revenue')}
              className="px-4 py-2 border border-gray-700">Revenue</th>
            <th onClick={() => handleSort('netIncome')}
              className="px-4 py-2 border border-gray-700">Net Income</th>
            <th onClick={() => handleSort('grossProfit')}
              className="px-4 py-2 border border-gray-700">Gross Profit</th>
            <th onClick={() => handleSort('eps')}
              className="px-4 py-2 border border-gray-700">EPS (Earnings Per Share)</th>
            <th onClick={() => handleSort('operatingIncome')}
              className="px-4 py-2 border border-gray-700">Operating Income</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}
              className="odd:bg-white even:bg-gray-50 hover:bg-gray-100">
              <td className="px-4 py-2 border border-gray-700">{item.date}</td>
              <td className="px-4 py-2 border border-gray-700">{item.revenue}</td>
              <td className="px-4 py-2 border border-gray-700">{item.netIncome}</td>
              <td className="px-4 py-2 border border-gray-700">{item.grossProfit}</td>
              <td className="px-4 py-2 border border-gray-700">{item.eps}</td>
              <td className="px-4 py-2 border border-gray-700">{item.operatingIncome}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FinancialData;
